import { IonItem, IonLabel, IonList } from "@ionic/react";

function List(items: []) {
  if (items === null || items === undefined) return "";
  let myList;
  items.forEach((elem) => {
    myList.push(
      <IonItem>
        <IonLabel>{elem}</IonLabel>
      </IonItem>
    );
  });
  return <IonList>{myList}</IonList>;
}

export default List;
